import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import Welcome from './components/Welcome';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Welcome />}/>
      </Routes>
    </div>
  );
}

export default App;
